# -*- coding: utf-8 -*-
import numpy as np
from collections import namedtuple
from typing import List, Tuple
from dataclasses import dataclass
from queue import PriorityQueue
Item = namedtuple("Item", ['index', 'value', 'weight','density'])

@dataclass
class TreeNode:
    items: List[Item]
    index: int
    value: int
    weight: int

# Modify the linRelaxSolver class to accommodate the changes
class linRelaxSolver:
    def __init__(self, capacity, items):
        self.capacity = capacity
        self.items = sorted(items, key=lambda x: x.value / x.weight, reverse=True)
        self.best_est = 0
        self.solution = []
        self.queue = [TreeNode([], 0, 0, 0)]  # Start with an empty node

    def format_solution(self):
        solution = [s.index for s in self.solution]
        return [1 if x.index in solution else 0 for x in self.items]

    def compute_bound(self, node):
        remaining_capacity = self.capacity - node.weight
        bound = node.value

        for item in self.items[node.index:]:
            if item.weight <= remaining_capacity:
                bound += item.value
                remaining_capacity -= item.weight
            else:
                fraction = remaining_capacity / item.weight
                bound += fraction * item.value
                break

        return bound

    def below_bound(self, node):
        if node.weight > self.capacity:
            return False
        if node.value + self.compute_bound(node) < self.best_est:
            return False
        return True

    def branch_and_bound_search(self):
        while self.queue:
            node = self.queue.pop(0)

            if node.weight <= self.capacity:
                if node.value > self.best_est:
                    self.best_est = node.value
                    self.solution = node.items

            if node.index < len(self.items):
                item = self.items[node.index]
                include = TreeNode(
                    items=node.items + [item],
                    index=node.index + 1,
                    value=node.value + item.value,
                    weight=node.weight + item.weight
                )
                if self.below_bound(include):
                    self.queue.append(include)

                exclude = TreeNode(
                    items=node.items,
                    index=node.index + 1,
                    value=node.value,
                    weight=node.weight
                )
                if self.below_bound(exclude):
                    self.queue.append(exclude)



def compute_bound(node,capacity, items):
    remaining_capacity = capacity - node.weight
    bound = node.value

    for item in items[node.index:]:
        if item.weight <= remaining_capacity:
            bound += item.value
            remaining_capacity -= item.weight
        else:
            fraction = remaining_capacity / item.weight
            bound += fraction * item.value
            break

    return bound

def branch_and_bound_search(capacity, items):
    items = sorted(items, key=lambda x: x.value / x.weight, reverse=True)
    n = len(items)
    best_value = 0
    best_node = None

    # Initialize priority queue
    queue = PriorityQueue()
    queue.put((-items[0].value, TreeNode([], 0, 0, 0)))

    while not queue.empty():
        # Get the most promising node from the priority queue
        priority, node = queue.get()
        index = node.index

        # Check if node is a leaf
        if index == n:
            if node.value > best_value:
                best_value = node.value
                best_node = node
        else:
            item = items[index]

            # Include item
            include = TreeNode(
                node.items + [item],
                index + 1,
                node.value + item.value,
                node.weight + item.weight
            )
            if include.weight <= capacity and include.value + compute_bound(include,capacity,items) >= best_value:
                queue.put((-include.value, include))

            # Exclude item
            exclude = TreeNode(
                node.items,
                index + 1,
                node.value,
                node.weight
            )
            if exclude.weight <= capacity and exclude.value + compute_bound(exclude,capacity,items) >= best_value:
                queue.put((-exclude.value, exclude))
    items = sorted(items, key=lambda x: x.index)
    f_mat_items = [1 if x.index in [s.index for s in best_node.items] else 0 for x in items]
    return best_node.value, f_mat_items

def solver_dp_table(capacity:int,items:List[Item]) ->Tuple[int,List[int]]:
    tbl = np.zeros((capacity+1,len(items)+1))
    for j in range(len(items)+1):
        for i in range(capacity+1):
            if j ==0 or i ==0:
                pass
            elif items[j-1].weight > i:
                tbl[i,j]= tbl[i,j-1]
            else:
                tbl[i,j] = max(tbl[i,j-1],
                               (items[j-1].value + tbl[i-items[j-1].weight][j-1]))
            
    #step through table to find selected
    selected = []
    row_idx = capacity
    col_idx = len(items)
    optimal_value = tbl[row_idx,col_idx]
    while len(selected) < len(items):
        #iterate until done
        if tbl[row_idx][col_idx] != tbl[row_idx][col_idx-1]:
            selected.append(1)
            row_idx -= items[col_idx-1].weight
        else:
            selected.append(0)
        col_idx-=1
    #reverse 
    selected = list(reversed(selected))
    return optimal_value,selected

